('calendar', '1^The Great Melting^2024-08-20 00:00^The beaches are dissolving. Swim at your own risk.^56^Beach Apocalypse^2024-09-05 00:00^All sand has turned to glass.^57^12^;\n2^Neon Mourning Day^2024-08-28 11:00^Wear bright colors to distract from the void.^73^^^^1;\n4^Zing’s Final Words^2024-09-10 00:00^Zing whispers a secret... then collapses.^23^^^^^^2;\n6^The Harvest of Tears^2024-09-25 00:00^Crops now grow in the shape of sobbing faces.^59^Harvest of Despair^2024-10-08 00:00^The faces have started screaming.^60^13^;\n11^Crimson Flood^2024-10-04 11:00^The rivers run red. Dress appropriately.^73^^^^1;\n12^The Laughing Plague^2024-10-20 00:00^Everyone laughs until they choke.^61^Silence Falls^2024-11-05 00:00^Nobody remembers how to speak.^62^2^;\n21^The Last Costume^2024-10-31 11:00^Wear your skin inside out.^25^^^^1;\n28^The Lonely Feast^2024-11-27 11:00^A banquet where nobody eats.^48^^^^7;\n31^The Bleak Solstice^2024-12-15 00:00^The sun refuses to rise.^46^Eternal Night^2025-01-05 00:00^It never will again.^46^4^;\n32^The Broken Tree^2024-12-24 00:00^The gifts are empty.^2^^^^1;\n33^The Year That Wasn’t^2024-12-31 00:00^2025 has been canceled.^90^^^^1;\n50^The Last Hug^2025-02-12 00:00^Hold someone. It won’t help.^71^The Hollow Goodbye^2025-03-01 00:00^They’re already gone.^71^16^;\n65^The Forgotten Name^2025-02-14 11:00^Who were you again?^47^^^^7;\n77^The Green That Wasn’t^2025-03-15 00:00^All color has faded.^43^The Gray^2025-03-18 00:00^Only gray remains.^43^18^;\n80^The Un-Spring^2025-03-21 00:00^The flowers bloom... backwards.^75^^^^1;\n85^The Hollow Blossoms^2025-04-01 00:00^Flowers bloom, but their scent is memory loss.^34^The Forgetting^2025-04-10 00:00^Petals turn to ash in your hands.^34^9^;\n88^The False Dawn^2025-04-15 11:00^The sunrise plays in reverse.^67^^^^7;\n90^The Weightless Rain^2025-04-22 00:00^Drops fall upward. Umbrellas useless.^51^Skyward Flood^2025-05-03 00:00^The oceans begin to follow.^51^11^;\n95^The Silent Parade^2025-05-05 00:00^Marching with no sound or footprints.^38^^^^1;\n97^The Cracked Mirror Moon^2025-05-12 00:00^The moon\'s reflection shows... something else.^64^Sevenfold Reflection^2025-05-20 00:00^Now all mirrors show it.^64^8^;\n99^The Last Meal^2025-05-25 11:00^Everything tastes like endings.^49^^^^7;\n100^The Clockwork Halt^2025-06-01 00:00^All clocks stop at 3:07 AM.^55^Timeless^2025-06-06 00:00^Nobody ages. Nobody dies.^55^5^;\n103^The Paper Sun^2025-06-10 11:00^It burns cold and leaves no shadow.^72^^^^1;\n105^The Childless Lullaby^2025-06-18 00:00^All nursery rhymes now end in silence.^40^Empty Cribs^2025-06-25 00:00^The babies were never there.^40^7^;\n110^The Final Question^2025-06-30 23:59^\"Why?\" has been removed from language.^91^^^^1;');

CREATE TABLE `messages` (
  `id` int(11) NOT NULL,
  `author` varchar(255) NOT NULL,
  `message` text NOT NULL,
  `room` varchar(255) NOT NULL,
  `time` timestamp NOT NULL DEFAULT current_timestamp()
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COLLATE=latin1_swedish_ci;


CREATE TABLE `pets` (
  `id` int(11) NOT NULL,
