  `rest` int(11) NOT NULL DEFAULT 100,
  `power` int(11) NOT NULL DEFAULT 100,
  `happy` int(11) NOT NULL DEFAULT 100
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COLLATE=latin1_swedish_ci;

